(4370, '1', 1, '17', 's1', NULL, 'ผลิตภัณฑ์คุณภาพสูง: ไทยยูเนี่ยน กรุ๊ป มีผลิตภัณฑ์ที่มีคุณภาพสูงในหลากหลายกลุ่มสินค้า เช่น นมเปรี้ยว, เครื่องดื่มอัลมอนด์, และผลิตภัณฑ์เสริมอาหาร', '0.50', 5, '2.50', '2023-08-09 21:18:06', '2023-08-09 21:18:06', 'ผลิตและส่งออกอาหารสำเร็จรูปแช่แข็งและบรรจุกระป๋อง และขยายธุรกิจให้ครบวงจรด้วยธุรกิจอาหารสำเร็จรูปและอาหารว่าง โดยเน้นอาหารทะเล ธุรกิจบรรจุภัณฑ์และสิ่งพิมพ์ ธุรกิจการตลาดภายในประเทศ ธุรกิจอาหารสัตว์ และธุรกิจพัฒนาสายพันธุ์กุ้งเพื่อจำหน่าย', 'บริษัท ไทยยูเนี่ยน กรุ๊ป จำกัด (มหาชน)'),
